import React from 'react';
import './Profile.css';

function Profile(){
    return (
        <>
            <ul class="menu">
                <li>
                    <a tabindex="3" href="../workout/workout.html"><i class="fa-solid fa-dumbbell"></i></a>
                </li>
                <li>
                    <a tabindex="2" href="../profile/profile.html" class="active"><i class="fa-solid fa-user"></i></a>
                </li>
            </ul>
            <ul class="menu_2">
                <li>
                    <a tabindex="1" href="../home/home.html"><i class="fa-solid fa-house"></i></a>
                </li>
                <li style={{float: "right"}}>
                    <a tabindex="4" href="../index.html">Log out</a>
                </li>
            </ul>
        </>
    );
}

export default Profile;
